-- Задание 6.2

CREATE TABLE likes (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  user_id INT UNSIGNED NOT NULL,
  target_id INT UNSIGNED NOT NULL,
  target_type_id INT UNSIGNED NOT NULL,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE target_types (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  name VARCHAR(255) NOT NULL UNIQUE
);


SELECT * FROM target_types ORDER BY id;

SELECT COUNT(*) FROM users;
SELECT COUNT(*) FROM media;
SELECT COUNT(*) FROM messages;

  SELECT 
    id, 
    FLOOR(1 + (RAND() * 200)), 
    FLOOR(1 + (RAND() * 400)),
    FLOOR(1 + (RAND() * 4)),
    CURRENT_TIMESTAMP 
  FROM messages;

UPDATE likes SET target_id = FLOOR(1 + (RAND() * 200)) WHERE target_type_id = 2;
  
SELECT * FROM likes LIMIT 20;


CREATE TABLE posts (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  user_id INT UNSIGNED NOT NULL,
  community_id INT UNSIGNED,
  head VARCHAR(255),
  body TEXT NOT NULL,
  media_id INT UNSIGNED,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);


SELECT * FROM posts WHERE created_at > updated_at;

UPDATE posts SET updated_at = CURRENT_TIMESTAMP() WHERE created_at > updated_at;

SELECT * FROM posts ORDER BY community_id;

UPDATE posts SET community_id = NULL WHERE community_id = 0;


SELECT * FROM profiles LIMIT 20;

SELECT COUNT(*) FROM media;

UPDATE profiles SET photo_id = FLOOR(1 + RAND() * 400);


SELECT * FROM messages;

UPDATE messages SET community_id = NULL WHERE community_id > FLOOR(1 + RAND() * 20);

UPDATE messages SET to_user_id = NULL WHERE to_user_id > FLOOR(1 + RAND() * 200) AND community_id IS not NULL;  

UPDATE messages SET community_id = 
  (SELECT community_id FROM communities_users WHERE communities_users.user_id = messages.from_user_id ORDER BY RAND() LIMIT 1)
  WHERE community_id IS NOT NULL; 

UPDATE messages SET to_user_id = 
  (SELECT user_id FROM communities_users WHERE communities_users.community_id = messages.community_id ORDER BY RAND() LIMIT 1)
  WHERE community_id IS NOT NULL; 

SELECT * FROM messages WHERE from_user_id = to_user_id;

UPDATE messages SET to_user_id = 
  (SELECT user_id FROM communities_users WHERE communities_users.community_id = messages.community_id ORDER BY RAND() LIMIT 1)
  WHERE from_user_id = to_user_id;


-- Задание 6.1

DESC communities_users;

ALTER TABLE communities_users 
  ADD CONSTRAINT communities_users_community_id_fk
    FOREIGN KEY (community_id) REFERENCES communities(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT communities_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE;

DESC friendship;

ALTER TABLE friendship 
  ADD CONSTRAINT friendship_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT friendship_friend_id_fk
    FOREIGN KEY (friend_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT friendship_status_id_fk
    FOREIGN KEY (status_id) REFERENCES friendship_statuses(id)
      ON DELETE CASCADE;

DESC likes;

ALTER TABLE likes 
  ADD CONSTRAINT likes_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT likes_target_type_id_fk
    FOREIGN KEY (target_type_id) REFERENCES target_types(id)
      ON DELETE CASCADE;

DESC media;

ALTER TABLE media 
  ADD CONSTRAINT media_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT media_media_type_id_fk
    FOREIGN KEY (media_type_id) REFERENCES media_types(id)
      ON DELETE CASCADE;

DESC messages;

ALTER TABLE messages 
  ADD CONSTRAINT messages_from_user_id_fk
    FOREIGN KEY (from_user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT messages_to_user_id_fk
    FOREIGN KEY (to_user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT messages_community_id_fk
    FOREIGN KEY (community_id) REFERENCES communities(id)
      ON DELETE CASCADE;

DESC posts;

ALTER TABLE posts 
  ADD CONSTRAINT posts_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT posts_community_id_fk
    FOREIGN KEY (community_id) REFERENCES communities(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT posts_media_id_fk
    FOREIGN KEY (media_id) REFERENCES media(id)
      ON DELETE CASCADE;

DESC profiles;

ALTER TABLE profiles 
  ADD CONSTRAINT profiles_user_id_fk
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE,
  ADD CONSTRAINT profiles_photo_id_fk
    FOREIGN KEY (photo_id) REFERENCES media(id)
      ON DELETE SET NULL;


-- Задание 6.3

SELECT COUNT(*) AS likes_to_ten_youngest
  FROM likes
  WHERE target_id IN (SELECT * FROM (SELECT user_id FROM profiles ORDER BY birthday DESC LIMIT 10) AS ten_youngest) AND
  target_type_id = (SELECT id FROM target_types WHERE name = 'users');


-- Задание 6.4

SELECT IF((
  SELECT COUNT(*) 
    FROM likes
    WHERE user_id IN (SELECT user_id FROM profiles WHERE gender = 'm'))
  > (
  SELECT COUNT(*)
    FROM likes
    WHERE user_id IN (SELECT user_id FROM profiles WHERE gender = 'f')),
  'men',
  'women'
) AS winners;


-- Проверка

SELECT  
(SELECT COUNT(*) 
  FROM likes
  WHERE user_id IN (SELECT user_id FROM profiles WHERE gender = 'm')) AS men_likes,
(SELECT COUNT(*) 
  FROM likes
  WHERE user_id IN (SELECT user_id FROM profiles WHERE gender = 'f')) AS women_likes;
  
  
-- Задание 6.5

SELECT 
    first_name, 
    last_name, 
    (SELECT COUNT(*) FROM likes WHERE likes.user_id = users.id) + 
    (SELECT COUNT(*) FROM media WHERE media.user_id = users.id) + 
    (SELECT COUNT(*) FROM messages WHERE messages.from_user_id = users.id) +
    (SELECT COUNT(*) FROM posts WHERE posts.user_id = users.id) AS activity 
  FROM users
  ORDER BY activity, users.id
  LIMIT 10;
  
  